import React from 'react'

export default function Cart({cart}) {
  return (
    <div className="cart">
        <h1>VOICI</h1>
        {cart.map((item, index) => {
            return <div className='cart-item' key={index}>

                <p>{item.name}</p>
            </div>
        })}
    </div>
  )
}
